  return (
    <AuthProvider value={{
      user: "blah"
      }}>
      <Router>
            <div>
              <ul>
                <li>
                  <Link to="/">Home Page</Link>
                </li>
                <li>
                  <Link to="/admin">Admin Page</Link>
                </li>
              </ul>
              <Route exact path="/" component={Home}/>
              <Route path="/home" component={Home} />
              <PrivateRoute path="/admin" component={Admin} />
            </div>
      </Router>
    </AuthProvider>
  );
}
